import React, { Component } from 'react';
import SideMenu from './side-menu';
import CovidCarrierStatus from './covid-carrier-status';
import CovidCarrierNumber from './covid-carrier-number';
import CovidTestedNumber from './covid-tested-number';
import CovidPatientData from './covid-patient-data';
import CovidNewsList from './covid-news';
import CovidAdviceCenter from './covid-advice-center';
import CovidCallCenter from './covid-call-center';
import Drawer from './drawer';
import Footer from './footer';

function App() {
  const style = {
    width: "100%",
    margin: "15px auto 0 auto",
    fontSize: "200%",
  };
  return (
    <div className="container-fluid">
      <div className="container test">
        <div style={style}>
          <Drawer />
        </div>
        <div class="d-flex align-content-around flex-wrap">.
          <div className="side-wrapper flex-grow-1">
            <div className="cont-side">
              <div className="d-none d-md-block ">
                <SideMenu />
              </div>
            </div>
          </div>
          <div className="main-wrapper">
            <div className="cont-main">
              <div className="row">
                <div className="col-12 col-lg-12">
                  <CovidNewsList />
                </div>
                <div className="col-12 col-lg-6">
                  <CovidCarrierNumber />
                </div>
                <div className="col-12 col-lg-6">
                  <CovidTestedNumber />
                </div>
                <div className="col-12 col-lg-12">
                  <CovidCarrierStatus />
                </div>
                <div className="col-12 col-lg-12">
                  <CovidPatientData />
                </div>
                <div className="col-12 col-lg-6">
                  <CovidAdviceCenter />
                </div>
                <div className="col-12 col-lg-6">
                  <CovidCallCenter />
                </div>
              </div>
            </div>
          </div>
        </div>
        <Footer />
      </div>
    </div>
  );
}

export default App;
